import logo from './logo.svg';
import './App.css';
function App() {
  return (
     <BrowserRouter>
     <Header/>
      <Routes>
        <Route path="/" element={<Login/>}/>
        <Route path="/register" element={<Register/>}/>
        <Route/>
      </Routes>
     </BrowserRouter>
  );
}

export default App;
